import {Route, Switch, BrowserRouter } from "react-router-dom";

/* Views */
import Home from "./views/Home";

/* Components */
import Nav from "./components/Nav";
import Footer from "./components/Footer";

function App() {
  return (<>
    <div className="App">
      <div className="pt-3">
        <Nav/>

      <BrowserRouter>
        <Switch>
            <Route path="/" exact component={Home}/>
        </Switch>
      </BrowserRouter>
      </div>

    </div>
    <div>
      <Footer/>
    </div>
    </>
  );
}

export default App;
